import React, {FC} from 'react';
import {Center} from "native-base";
import {StyledWRIndexTag} from "./WRIndex.styled";

type WRIndexMainCardType = {
    tag: {
        first: string;
        second?: string;
    };
    title: string;
    timeArrange: string;
    oneLineComment: string;
};

type WRIndexMainCardProps = {
    data: WRIndexMainCardType;
};

const WRIndexMainCard: FC<WRIndexMainCardProps> = ({data}) => {
    return (
        <Center bg={'#1C1C1E'} borderRadius={24}>
            {/*<Box>*/}

            {/*</Box>*/}
            <StyledWRIndexTag>{data.tag.first}</StyledWRIndexTag>
            {data.tag.second && (
                <StyledWRIndexTag>{data.tag.second}</StyledWRIndexTag>
            )}
            <StyledWRIndexTag tag={"alakllkal"}/>
        </Center>
    );
};

export {WRIndexMainCard};
